webpackJsonp([0xc1c72f2466cc],{580:function(t,e){t.exports={data:{markdownRemark:{html:'<h2>Meteor it is.</h2>\n<p>GameTree is a project I am assisting with and they have decided to use the following stack:</p>\n<ol>\n<li>Meteor</li>\n<li>Jade for HTML syntax</li>\n<li>SASS for CSS Preprocessing</li>\n<li>CoffeeScript for JavaScript</li>\n<li>Foundation for a front-end framework</li>\n<li>MongoDB for the database (non-optional with Meteor)</li>\n</ol>\n<p>Of these 5 things, I have worked with SASS and Foundation before. So, I have my work cut out for me.</p>\n<h3>Meaty Yore</h3>\n<p>I heard of Meteor on a <a href="http://www.codenewbie.org/podcast/meteor">Code Newbie podcast</a> while on my VisionQuest 2015 road trip when I was debating making the big jump to a new career.  It sounded awesome but at the time my JS skills were not all that sharp. Well fast-forward to today and here I am, about to embark on some Meteor goodness with a decent sized Dev team.</p>\n<h3>Mongo Like</h3>\n<p>Some things to know right off the bat: MongoDB uses different vocabulary than the SQL gang.</p>\n<table>\n<thead>\n<tr>\n<th>SQL</th>\n<th>Mongo</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>table</td>\n<td>collection</td>\n</tr>\n<tr>\n<td>row</td>\n<td>document</td>\n</tr>\n<tr>\n<td>column</td>\n<td>field</td>\n</tr>\n</tbody>\n</table>\n<p>The only one I have trouble understanding is document for row.</p>',frontmatter:{date:"June 01, 2016",path:"/blog/meteor/",title:"Meteor",type:"blog"}}},pathContext:{}}}});
